import React from "react";
import Smileys from "./Smileys";
import { Shake, ShakeHard } from "reshake";
const Experience = () => {
  const placesWhereIWorked = [
    {
      name: "CCCCCompany",
      city: "Barcelona",
      country: "Spain",
      jobTitle: "Things",
      jobDescription:
        "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua",
      jobStarted: "2017",
      jobEnded: ""
    },
    {
      name: "company",
      city: "Madrid",
      country: "Spain",
      jobTitle: "gellosda",
      jobDescription:
        "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua",
      jobStarted: "2015",
      jobEnded: "2017"
    }
  ];

  return (
    <div className="">
      <ShakeHard className="aboutparagraph">
        My name is Calle and I’m currently doing my master in graphic design at
        the American school Rhode Island School of design. I’m in my second out
        of three year. I stumbled upon your site on are.na and I really like it.
        This summer I’m looking to be somewhere where I can learn more about
        form, identities and experimental use of web. I like interaction design,
        but I’m more interested in interactions that contain a bit of friction
        than the ones that happens super smooth. I mean, why would we want to
        serve people the design on a plate when we can make them work for it,
        and then hopefully they’ll enjoy it even more.
      </ShakeHard>
      {placesWhereIWorked.map((eachPlace, index) => {
        return (
          <div className="experience-content" key={index}>
            {/* <h3>{eachPlace.name}</h3>
            <p>
              {eachPlace.city}, {eachPlace.country}
            </p>
            <h4>{eachPlace.jobTitle}</h4>
            <p>{eachPlace.jobDescription}</p>
            <p>
              {eachPlace.jobStarted} - {eachPlace.jobEnded || "current"}
            </p> */}
          </div>
        );
      })}
    </div>
  );
};

export default Experience;
